contains

  function vernerConstructorParameters(parameters) result(self)
    !!{
    Constructor for the {\normalfont \ttfamily verner} atomic photoionization cross-section class which builds the object from a parameter set.
    !!}
    use :: Input_Parameters, only : inputParameters
    implicit none
    type(atomicCrossSectionIonizationPhotoVerner)                :: self
    type(inputParameters                        ), intent(inout) :: parameters

    self=atomicCrossSectionIonizationPhotoVerner()
    !![
    <inputParametersValidate source="parameters"/>
    !!]
    return
  end function vernerConstructorParameters

  double precision function vernerCrossSection(self,atomicNumber,ionizationState,shellNumber,wavelength)
    !!{
    Computes the cross section for photo-ionization (in units of cm$^2$) at the specified {\normalfont \ttfamily
    wavelength} for all ionization stages of all atoms from H to Zn
    ($Z=30$) by use of the following fit parameters:
    \begin{itemize}
    \item Outer shells of the Opacity Project (OP) elements: \cite{verner_atomic_1996_1}
    \item Inner shells of all elements, and outer shells of the non-OP elements: \cite{verner_analytic_1995}
    \end{itemize}
    Original version (\href{https://web.archive.org/web/20220313133758/https://www.pa.uky.edu/~verner/dima/rec/rrfit.f}{\normalfont \ttfamily phfit2.f}) written by
    \href{mailto:verner@pa.uky.edu}{D. A. Verner} (Version 2. March 25, 1996).
    Inner-shell ionization energies of some low-ionized species are slightly
    improved to fit smoothly the experimental inner-shell ionization energies
    of neutral atoms.
    !!}
    use :: Numerical_Constants_Physical, only : plancksConstant  , speedLight
    use :: Numerical_Constants_Prefixes, only : centi            , mega
    use :: Numerical_Constants_Units   , only : angstromsPerMeter, barn      , electronVolt
    implicit none
    class           (atomicCrossSectionIonizationPhotoVerner), intent(inout) :: self
    integer                                                  , intent(in   ) :: atomicNumber  , ionizationState , shellNumber
    double precision                                         , intent(in   ) :: wavelength
    integer                                                                  :: electronNumber, innerShellNumber, outerShellNumber
    double precision                                                         :: coefficient   , energy          , energyFactor    , energyModified   , &
         &                                                                      energyScaled  , exponent1       , exponent2       , innerShellEnergy
    !$GLC attributes unused :: self

    ! Set a default cross section of zero.
    vernerCrossSection=0.0d0
    ! Compute number of electrons.
    electronNumber=atomicNumber-ionizationState+1
    ! Return zero cross section for out of range and unphysical cases.
    if (atomicNumber   < 1 .or. atomicNumber   > 30          ) return
    if (electronNumber < 1 .or. electronNumber > atomicNumber) return
    ! Compute the number of the outer shell.
    outerShellNumber=outerShellNumbers(electronNumber)
    if (atomicNumber == electronNumber   .and.       atomicNumber >  18  ) outerShellNumber=7
    if (atomicNumber == electronNumber+1 .and. (     atomicNumber == 20                       &
         &                                      .or. atomicNumber == 21                       &
         &                                      .or. atomicNumber == 22                       &
         &                                      .or. atomicNumber == 25                       &
         &                                      .or. atomicNumber == 26                       &
         &                                     )                         ) outerShellNumber=7
    ! Return if there are no electrons in the requested shell.
    if (shellNumber > outerShellNumber) return
    ! Compute the energy (in electronvolts) corresponding to the given wavelength (in Angstroms).
    energy=+plancksConstant   &
         & *speedLight        &
         & *angstromsPerMeter &
         & /electronVolt      &
         & /wavelength
    ! Return if the energy is less than the ionization energy for the given shell.
    if (energy < fitCoefficients1(1,atomicNumber,electronNumber,shellNumber)) return
    ! Compute the inner shell number.
    innerShellNumber=innerShellNumbers(electronNumber)
    if     (      atomicNumber == 15 &
         &  .or.  atomicNumber == 17 &
         &  .or.  atomicNumber == 19 &
         &  .or. (atomicNumber >  20 &
         &        .and.              &
         &        atomicNumber /= 26 &
         &       )                   &
         & ) then
       innerShellEnergy=0.0d0
    else
       if ( electronNumber < 3) then
          innerShellEnergy=huge(1.0d0)
       else
          innerShellEnergy=fitCoefficients1(1,atomicNumber,electronNumber,innerShellNumber)
       end if
    end if
    ! Return if the energy is insufficient.
    if (shellNumber < outerShellNumber .and. shellNumber > innerShellNumber .and. energy < innerShellEnergy) return
    ! Evaluate the fitting functions.
    if (shellNumber <= innerShellNumber .or. energy >= innerShellEnergy) then
       exponent2         =-      fitCoefficients1(5,atomicNumber,electronNumber,shellNumber)
       energyScaled      =+energy                                                               &
            &             /      fitCoefficients1(2,atomicNumber,electronNumber,shellNumber)
       exponent1         =-0.5d0                                                                &
            &             *exponent2                                                            &
            &             -dble(                                                                &
            &                    fitCoefficientL (                              shellNumber)    &
            &                   )                                                               &
            &             -5.5d0
       coefficient       =+      fitCoefficients1(3,atomicNumber,electronNumber,shellNumber)    &
            &             *(                                                                    &
            &               +(                                                                  &
            &                 +energyScaled                                                     &
            &                 -1.0d0                                                            &
            &                )                                                              **2 &
            &               +    fitCoefficients1(6,atomicNumber,electronNumber,shellNumber)**2 &
            &              )
       energyFactor      =+sqrt(                                                                &
            &                   +energyScaled                                                   &
            &                   /fitCoefficients1(4,atomicNumber,electronNumber,shellNumber)    &
            &                  )                                                                &
            &             +1.0d0
       vernerCrossSection=+coefficient                                                          &
            &             *energyScaled**exponent1                                              &
            &             *energyFactor**exponent2
    else
       exponent2         =-      fitCoefficients2(4,atomicNumber,electronNumber            )
       exponent1         =-0.5d0                                                                &
            &             *exponent2                                                            &
            &             -5.5d0
       energyScaled      =+energy&
            &             /      fitCoefficients2(1,atomicNumber,electronNumber            )    &
            &             -      fitCoefficients2(6,atomicNumber,electronNumber            )
       energyModified    =+sqrt(&
            &                   +energyScaled                                               **2 &
            &                   +fitCoefficients2(7,atomicNumber,electronNumber            )**2 &
            &                  )
       coefficient       =+      fitCoefficients2(2,atomicNumber,electronNumber            )    &
            &             *(                                                                    &
            &               +(                                                                  &
            &                 +energyScaled                                                     &
            &                 -1.0d0                                                            &
            &                )                                                              **2 &
            &               +    fitCoefficients2(5,atomicNumber,electronNumber            )**2 &
            &              )
       energyFactor      =+1.0d0                                                                &
            &             +sqrt(                                                                &
            &                   +energyModified                                                 &
            &                   /fitCoefficients2(3,atomicNumber,electronNumber            )    &
            &                  )
       vernerCrossSection=+coefficient                                                          &
            &             *energyModified**exponent1                                            &
            &             *energyFactor  **exponent2
    end if
    ! Convert cross section to cm².
    vernerCrossSection   =+vernerCrossSection                                                   &
         &                *mega                                                                 &
         &                *barn                                                                 &
         &                /centi                                                            **2
    return
  end function vernerCrossSection
